import React from "react";
import {Card} from "react-bootstrap";
import '../components/styles/contactUs.css';

const ContactUs = (props) => {

    return(
        <Col>
            <Card className='ContactUs'>
                <Card.Img className='CardImg' src={props.card.image}></Card.Img>
                <Card.Title>
                    {props.card.title}
                </Card.Title>
                <Card.Text>
                    {props.card.content1}<br/>
                    {props.card.content2}
                </Card.Text>
            </Card>
        </Col>
    );
};

export default ContactUs;
